definition:
The art or representation by pictures or images; the
   description or study of portraiture or representation, as of persons;
   as, the iconography of the ancients.

The faculty or capacity of the mind for forming ideas;
   the exercise of this capacity; the act of the mind by which objects of
   sense are apprehended and retained as objects of thought.

Uttering sameness or the same truth; expressing in the
   predicate what is given, or obviously implied, in the subject;
   tautological.

The condition or quality of being idle (in the various
   senses of that word); uselessness; fruitlessness; triviality;
   inactivity; laziness.

Hence: To refuse to take notice of; to shut the eyes to;
   not to recognize; to disregard willfully and causelessly; as, to ignore
   certain facts; to ignore the presence of an objectionable person.

Contrary to good, in a physical sense; contrary or opposed to
   advantage, happiness, etc.; bad; evil; unfortunate; disagreeable;
   unfavorable.

Whatever annoys or impairs happiness, or prevents success;
   evil of any kind; misfortune; calamity; disease; pain; as, the ills of
   humanity.

The act or process of inferring from premises or reasons;
   perception of the connection between ideas; that which is inferred;
   inference; deduction; conclusion.

Relating to, dependent on, or denoting, illation;
   inferential; conclusive; as, an illative consequence or proposition; an
   illative word, as then, therefore, etc.

Not according to, or authorized by, law; specif., contrary
   to, or in violation of, human law; unlawful; illicit; hence, immoral;
   as, an illegal act; illegal trade; illegal love.

The quality or condition of being illegal;
   unlawfulness; as, the illegality of trespass or of false imprisonment;
   also, an illegal act.

Rhetorical decoration in writing or speaking; vivid
   descriptions presenting or suggesting images of sensible objects;
   figures in discourse.

The imagine-making power of the mind; the power to
   create or reproduce ideally an object of sense previously perceived;
   the power to call up mental imagines.

The power to recombine the materials furnished by
   experience or memory, for the accomplishment of an elevated purpose;
   the power of conceiving and expressing the ideal.

Destitute of strength, whether of body or mind; feeble;
   impotent; esp., mentally wea; feeble-minded; as, hospitals for the
   imbecile and insane.

In decorative art: Having scales lapping one over the
   other, or a representation of such scales; as, an imbricated surface;
   an imbricated pattern.

Not mature; unripe; not arrived at perfection of full
   development; crude; unfinished; as, immature fruit; immature character;
   immature plans.

Acting with nothing interposed or between, or without
   the intervention of another object as a cause, means, or agency;
   acting, perceived, or produced, directly; as, an immediate cause.

In an immediate manner; without intervention of any
   other person or thing; proximately; directly; -- opposed to mediately;
   as, immediately contiguous.

The state or quality of being immense; inlimited or
   immeasurable extension; infinity; vastness in extent or bulk;
   greatness.

Not moderate; exceeding just or usual and suitable
   bounds; excessive; extravagant; unreasonable; as, immoderate demands;
   immoderate grief; immoderate laughter.

Not moral; inconsistent with rectitude, purity, or good
   morals; contrary to conscience or the divine law; wicked; unjust;
   dishonest; vicious; licentious; as, an immoral man; an immoral deed.

The quality or state of being immovable; fixedness;
   steadfastness; as, immovability of a heavy body; immovability of
   purpose.

Not partial; not favoring one more than another;
   treating all alike; unprejudiced; unbiased; disinterested; equitable;
   fair; just.

Incapable of suffering; inaccessible to harm or pain;
   not to be touched or moved to passion or sympathy; unfeeling, or not
   showing feeling; without sensation.

Actuated or characterized by passion or zeal;
   showing warmth of feeling; ardent; animated; excited; as, an
   impassioned orator or discourse.

Incapable of being penetrated or pierced; not
   admitting the passage of other bodies; not to be entered; impervious;
   as, an impenetrable shield.

Expressive of command; containing positive command;
   authoritatively or absolutely directive; commanding; authoritative; as,
   imperative orders.

Not perishable; not subject to decay; indestructible;
   enduring permanently; as, an imperishable monument; imperishable
   renown.

Not pertinent; not pertaining to the matter in hand;
   having no bearing on the subject; not to the point; irrelevant;
   inapplicable.

Rushing with force and violence; moving with impetus;
   furious; forcible; violent; as, an impetuous wind; an impetuous
   torrent.

Not pious; wanting piety; irreligious; irreverent;
   ungodly; profane; wanting in reverence for the Supreme Being; as, an
   impious deed; impious language.

Virtually involved or included; involved in substance;
   inferential; tacitly conceded; -- the correlative of express, or
   expressed. See Imply.

The quality of being impolitic; inexpedience;
   unsuitableness to the end proposed; bads policy; as, the impolicy of
   fraud.

Not politic; contrary to, or wanting in, policy; unwise;
   imprudent; indiscreet; inexpedient; as, an impolitic ruler, law, or
   measure.

Troublesomely urgent; unreasonably solicitous;
   overpressing in request or demand; urgent; teasing; as, an impotunate
   petitioner, curiosity.

To request or solicit, with urgency; to press with
   frequent, unreasonable, or troublesome application or pertinacity;
   hence, to tease; to irritate; to worry.

An excessive, arbitrary, or unlawful exaction; hence, a
   trick or deception put on laid on others; cheating; fraud; delusion;
   imposture.

Not possible; incapable of being done, of existing,
   etc.; unattainable in the nature of things, or by means at command;
   insuperably difficult under the circumstances; absurd or impracticable;
   not feasible.

That which is imposed or levied; a tax, tribute, or duty;
   especially, a duty or tax laid by goverment on goods imported into a
   country.

The quality or condition of being impotent; want of
   strength or power, animal, intellectual, or moral; weakness;
   feebleness; inability; imbecility.

To shut up or place in an inclosure called a pound;
   hence, to hold in the custody of a court; as, to impound stray cattle;
   to impound a document for safe keeping.

A mark made by pressure; an indentation; imprint; the
   image or figure of anything, formed by pressure or as if by pressure;
   result produced by pressure or influence.

The act of impressing, or the state of being impressed;
   the communication of a stamp, mold, style, or character, by external
   force or by influence.

A license to print or publish a book, paper, etc.;
   also, in countries subjected to the censorship of the press, approval
   of that which is published.

The quality or state of being improbable;
   unlikelihood; also, that which is improbable; an improbable event or
   result.

Capable of being improved; susceptible of improvement;
   admitting of being made better; capable of cultivation, or of being
   advanced in good qualities.

To use or employ to good purpose; to make productive;
   to turn to profitable account; to utilize; as, to improve one's time;
   to improve his means.

The act of improving; advancement or growth; promotion
   in desirable qualities; progress toward what is better; melioration;
   as, the improvement of the mind, of land, roads, etc.

The state of being improved; betterment; advance;
   also, that which is improved; as, the new edition is an improvement on
   the old.

The quality of being impudent; assurance, accompanied
   with a disregard of the presence or opinions of others; shamelessness;
   forwardness; want of modesty.

To attack by words or arguments; to contradict; to
   assail; to call in question; to make insinuations against; to gainsay;
   to oppose.

The act of impelling, or driving onward with sudden force;
   impulsion; especially, force so communicated as to produced motion
   suddenly, or immediately.

With reference to physical surrounding, personal states,
   etc., abstractly denoted; as, I am in doubt; the room is in darkness;
   to live in fear.

Not accurate; not according to truth; inexact;
   incorrect; erroneous; as, in inaccurate man, narration, copy, judgment,
   calculation, etc.

Not adequate; unequal to the purpose; insufficient;
   deficient; as, inadequate resources, power, conceptions,
   representations, etc.

Not artificial; not made or elaborated by art;
   natural; simple; artless; as, an inartificial argument; an inartificial
   character.

In like degree; in like manner; seeing that;
   considering that; since; -- followed by as. See In as much as, under
   In, prep.

Not attentive; not fixing the mind on an object;
   heedless; careless; negligent; regardless; as, an inattentive spectator
   or hearer; an inattentive habit.

Not capable of being brought to do or perform, because
   morally strong or well disposed; -- used with reference to some evil;
   as, incapable of wrong, dishonesty, or falsehood.

Not in a state to receive; not receptive; not
   susceptible; not able to admit; as, incapable of pain, or pleasure;
   incapable of stain or injury.

To deprive of legal or constitutional requisites,
   or of ability or competency for the performance of certain civil acts;
   to disqualify.

An incarnate form; a personification; a manifestation;
   a reduction to apparent from; a striking exemplification in person or
   act.

Not cautious; not circumspect; not attending to the
   circumstances on which safety and interest depend; heedless; careless;
   as, an incautious step; an incautious remark.

Continuing or following without interruption; unceasing;
   unitermitted; uninterrupted; continual; as, incessant clamors;
   incessant pain, etc.

Happening, as an occasional event, without regularity;
   coming without design; casual; accidental; hence, not of prime concern;
   subordinate; collateral; as, an incidental conversation; an incidental
   occurrence; incidental expenses.

That which is produced by incising; the separation of the
   parts of any substance made by a cutting or pointed instrument; a cut;
   a gash.

Having the quality of incising, cutting, or penetrating,
   as with a sharp instrument; cutting; hence, sharp; acute; sarcastic;
   biting.

Physically severe or harsh (generally restricted to the
   elements or weather); rough; boisterous; stormy; rigorously cold, etc.;
   as, inclement weather.

Not coherent; wanting cohesion; loose; unconnected;
   physically disconnected; not fixed to each; -- said of material
   substances.

Wanting coherence or agreement; incongruous;
   inconsistent; having no dependence of one part on another; logically
   disconnected.

Tending to incommode; not commodious; not affording
   ease or advantage; unsuitable; giving trouble; inconvenient; annoying;
   as, an incommodious seat; an incommodious arrangement.

Not comparable; admitting of no comparison with
   others; unapproachably eminent; without a peer or equal; matchless;
   peerless; transcendent.

Want of competency or legal fitness; incapacity;
   disqualification, as of a person to be heard as a witness, or to act as
   a juror, or of a judge to try a cause.

Not competent; wanting in adequate strength, power,
   capacity, means, qualifications, or the like; incapable; unable;
   inadequate; unfit.

The quality of being incomprehensible, or
   beyond the reach of human intellect; incomprehensibleness;
   inconceivability; inexplicability.

Not following from the premises; not regularly
   inferred; invalid; not characterized by logical method; illogical;
   arbitrary; inconsistent; of no consequence.

The quality or state of being inconsistent;
   discordance in respect to sentiment or action; such contrariety between
   two things that both can not exist or be true together; disagreement;
   incompatibility.

Absurdity in argument ore narration; incoherence or
   irreconcilability in the parts of a statement, argument, or narration;
   that which is inconsistent.

Not consistent; showing inconsistency;
   irreconcilable; discordant; at variance, esp. as regards character,
   sentiment, or action; incompatible; incongruous; contradictory.

The quality or condition of being inconvenient; want
   of convenience; unfitness; unsuitableness; inexpediency; awkwardness;
   as, the inconvenience of the arrangement.

The union of something with a body already existing;
   association; intimate union; assimilation; as, the incorporation of
   conquered countries into the Roman republic.

Existing only in contemplation of law; not capable of
   actual visible seizin or possession; not being an object of sense;
   intangible; -- opposed to corporeal.

To augment or make greater in bulk, quantity, extent,
   value, or amount, etc.; to add to; to extend; to lengthen; to enhance;
   to aggravate; as, to increase one's possessions, influence.

A burdensome and troublesome load; anything that
   impedes motion or action, or renders it difficult or laborious; clog;
   impediment; hindrance; check.

Want of decision; want of settled purpose, or of
   firmness; indetermination; wavering of mind; irresolution; vacillation;
   hesitation.

Undetermined; prone to indecision; irresolute;
   unsettled; wavering; vacillating; hesitating; as, an indecisive state
   of mind; an indecisive character.

Incapable of being fatigued; not readily exhausted;
   unremitting in labor or effort; untiring; unwearying; not yielding to
   fatigue; as, indefatigable exertions, perseverance, application.

Not definite; not limited, defined, or specified; not
   explicit; not determined or fixed upon; not precise; uncertain; vague;
   confused; obscure; as, an indefinite time, plan, etc.

Security; insurance; exemption from loss or damage, past
   or to come; immunity from penalty, or the punishment of past offenses;
   amnesty.

Not dependent; free; not subject to control by others;
   not relying on others; not subordinate; as, few men are wholly
   independent.

A pressure gauge; a water gauge, as for a steam boiler;
   an apparatus or instrument for showing the working of a machine or
   moving part

Not mal/ing a difference; having no influence or
   preponderating weight; involving no preference, concern, or attention;
   of no account; without significance or importance.

In an indifferent manner; without distinction or
   preference; impartially; without concern, wish, affection, or aversion;
   tolerably; passably.

Lack of proper digestive action; a failure of the
   normal changes which food should undergo in the alimentary canal;
   dyspepsia; incomplete or difficult digestion.

Affected with indignation; wrathful; passionate; irate;
   feeling wrath, as when a person is exasperated by unworthy or unjust
   treatment, by a mean action, or by a degrading accusation.

Incapable of being rightfully broken or dissolved;
   perpetually binding or obligatory; firm; stable, as, an indissoluble
   league or covenant.

Not dissolvable; incapable of being dissolved or
   separated; incapable o/ separation; perpetually firm and binding;
   indissoluble; as, an indissolvable bond of union.

Obscure to the mind or senses; not clear; not definite;
   confused; imperfect; faint; as, indistinct vision; an indistinct sound;
   an indistinct idea or recollection.

The quality or state of being individual or
   constituting an individual; separate or distinct existence; oneness;
   unity.

The act or process of reasoning from a part to a whole,
   from particulars to generals, or from the individual to the universal;
   also, the result or inference so reached.

Fig.: To disorder the senses of; to exhilarate or
   elate as if by spirituous drink; to deprive of sense and judgment;
   also, to stupefy.

The condition of being inebriated; intoxication;
   figuratively, deprivation of sense and judgment by anything that
   exhilarates, as success.

Not producing the proper effect; without effect;
   inefficient; weak; useless; futile; unavailing; as, an ineffectual
   attempt; an ineffectual expedient.

Want of power to produce the desired or proper effect;
   inefficiency; ineffectualness; futility; uselessness; fruitlessness;
   as, the inefficacy of medicines or means.

Incapable of, or indisposed to, effective action;
   habitually slack or remiss; effecting little or nothing; as,
   inefficient workmen; an inefficient administrator.

Disproportion to any office or purpose; inadequacy;
   competency; as, the inequality of terrestrial things to the wants of a
   rational soul.

Incapable of being exhausted, emptied, or used up;
   unfailing; not to be wasted or spent; as, inexhaustible stores of
   provisions; an inexhaustible stock of elegant words.

Not to be persuaded or moved by entreaty or prayer;
   firm; determined; unyielding; unchangeable; inflexible; relentless; as,
   an inexorable prince or tyrant; an inexorable judge.

Not capable of expression or utterance in language;
   ineffable; unspeakable; indescribable; unutterable; as, inexpressible
   grief or pleasure.

Not capable of being extinguished;
   extinguishable; unquenchable; as, inextinguishable flame, light,
   thirst, desire, feuds.

Not liable to fail, deceive, or disappoint;
   indubitable; sure; certain; as, infallible evidence; infallible
   success; an infallible remedy.

Causing or producing infamy; deserving detestation;
   scandalous to the last degree; as, an infamous act; infamous vices;
   infamous corruption.

Having a bad name as being the place where an odious
   crime was committed, or as being associated with something detestable;
   hence, unlucky; perilous; dangerous.

A person who is not of full age, or who has not attained
   the age of legal capacity; a person under the age of twenty-one years;
   a minor.

That which infects, or causes the communicated disease;
   any effluvium, miasm, or pestilential matter by which an infectious
   disease is caused.

The state of being infected; contamination by morbific
   particles; the result of infecting influence; a prevailing disease;
   epidemic.

Having qualities that may infect; communicable or
   caused by infection; pestilential; epidemic; as, an infectious fever;
   infectious clothing; infectious air; infectious vices.

The state or quality of being infelicitous;
   unhappiness; misery; wretchedness; misfortune; want of suitableness or
   appropriateness.

Of or pertaining to, resembling, or inhabiting, hell;
   suitable for hell, or to the character of the inhabitants of hell;
   hellish; diabolical; as, infernal spirits, or conduct.

Want of faith or belief in some religious system;
   especially, a want of faith in, or disbelief of, the inspiration of the
   Scriptures, of the divine origin of Christianity.

Without limit in power, capacity, knowledge, or
   excellence; boundless; immeasurably or inconceivably great; perfect;
   as, the infinite wisdom and goodness of God; -- opposed to finite.

Fig.: To kindle or intensify, as passion or appetite;
   to excite to an excessive or unnatural action or heat; as, to inflame
   desire.

Violent excitement; heat; passion; animosity;
   turbulence; as, an inflammation of the mind, of the body politic, or of
   parties.

The quality or state of being inflexible, or not
   capable of being bent or changed; unyielding stiffness; inflexibleness;
   rigidity; firmness of will or purpose; unbending pertinacity;
   steadfastness; resoluteness; unchangeableness; obstinacy.

Power or authority arising from elevated station,
   excelence of character or intellect, wealth, etc.; reputation;
   acknowledged ascendency; as, he is a man of influence in the community.

Exerting or possessing influence or power; potent;
   efficacious; effective; strong; having authority or ascendency; as, an
   influential man, station, argument, etc.

A coming in; infusion; intromission; introduction;
   importation in abundance; also, that which flows or comes in; as, a
   great influx of goods into a country, or an influx of gold and silver.

News, advice, or knowledge, communicated by others
   or obtained by personal study and investigation; intelligence;
   knowledge derived from reading, observation, or instruction.

The act of infracting or breaking; breach; violation;
   nonobservance; infringement; as, an infraction of a treaty, compact,
   rule, or law.

The act of infringing; breach; violation;
   nonfulfillment; as, the infringement of a treaty, compact, law, or
   constitution.

The act of infusing, pouring in, or instilling;
   instillation; as, the infusion of good principles into the mind; the
   infusion of ardor or zeal.

The act or business of gathering or collecting
   anything; especially, the gathering of the fruits of the earth;
   harvest.

Possessed of genius, or the faculty of invention;
   skillful or promp to invent; having an aptitude to contrive, or to form
   new combinations; as, an ingenious author, mechanic.

Want of gratitude; insensibility to, forgetfulness of,
   or ill return for, kindness or favors received; unthankfulness;
   ungratefulness.

Of or pertaining to, or producing, inhibition;
   consisting in inhibition; tending or serving to inhibit; as, the
   inhibitory action of the pneumogastric on the respiratory center.

Having the disposition or temper of an enemy; unfriendly;
   unfavorable; -- chiefly applied to private, as hostile is to public,
   enmity.

Absence of, or deviation from, just dealing; want of
   rectitude or uprightness; gross injustice; unrighteousness; wickedness;
   as, the iniquity of bribery; the iniquity of an unjust judge.

Tending or serving to initiate; introducing by
   instruction, or by the use and application of symbols or ceremonies;
   elementary; rudimentary.

Causing injury or harm; hurtful; harmful; detrimental;
   mischievous; as, acts injurious to health, credit, reputation,
   property, etc.

Not official; not having official sanction or authoriy;
   not according to the forms or ceremony of official business; as,
   inofficial intelligence.

Not organic; without the organs necessary for life;
   devoid of an organized structure; unorganized; lifeness; inanimate; as,
   all chemical compounds are inorganic substances.

The entrance of an enemy into a country with purposes of
   hostility; a sudden or desultory incursion or invasion; raid;
   encroachment.

Not susceptible of emotion or passion; void of feeling;
   apathetic; unconcerned; indifferent; as, insensible to danger, fear,
   love, etc.; -- often used with of or to.

Incapable of being perceived by the senses;
   imperceptible. Hence: Progressing by imperceptible degrees; slow;
   gradual; as, insensible motion.

Situated upon, attached to, or growing out of, some part;
   -- said especially of the parts of the flower; as, the calyx, corolla,
   and stamens of many flowers are inserted upon the receptacle.

Being within; included or inclosed in anything; contained;
   interior; internal; as, the inside passengers of a stagecoach; inside
   decoration.

Distinguishing marks of authority, office, or honor;
   badges; tokens; decorations; as, the insignia of royalty or of an
   order.

The condition or quality of being insignificant;
   want of significance, sense, or meaning; as, the insignificance of
   words or phrases.

Not being in truth what one appears to be; not sincere;
   dissembling; hypocritical; disingenuous; deceitful; false; -- said of
   persons; also of speech, thought; etc.; as, insincere declarations.

Wanting in spirit, life, or animation; uninteresting;
   weak; vapid; flat; dull; heavy; as, an insipid woman; an insipid
   composition.

The quality of insisting, or being urgent or pressing;
   the act of dwelling upon as of special importance; persistence;
   urgency.

The quality of being insolent; pride or haughtiness
   manifested in contemptuous and overbearing treatment of others;
   arrogant contempt; brutal impudence.

Haughty and contemptuous or brutal in behavior or
   language; overbearing; domineering; grossly rude or disrespectful;
   saucy; as, an insolent master; an insolent servant.

The act or process of inspecting or looking at
   carefully; a strict or prying examination; close or careful scrutiny;
   investigation.

To infuse into the mind; to communicate to the spirit;
   to convey, as by a divine or supernatural influence; to disclose
   preternaturally; to produce in, as by inspiration.

Moved or animated by, or as by, a supernatural influence;
   affected by divine inspiration; as, the inspired prophets; the inspired
   writers.

The quality or condition of being unstable; want of
   stability, firmness, or steadiness; liability to give way or to fail;
   insecurity; precariousness; as, the instability of a building.

Lack of determination of fixedness; inconstancy;
   fickleness; mutability; changeableness; as, instability of character,
   temper, custom, etc.

To form by communication of knowledge; to inform the
   mind of; to impart knowledge or information to; to enlighten; to teach;
   to discipline.

Acting as an instrument; serving as a means;
   contributing to promote; conductive; helpful; serviceable; as, he was
   instrumental in conducting the business.

Incapable of being suffered, borne, or endured;
   insupportable; unendurable; intolerable; as, insufferable heat, cold,
   or pain; insufferable wrongs.

In a manner or to a degree beyond endurance;
   intolerably; as, a blaze insufferably bright; a person insufferably
   proud.

Of or pertaining to the people of an island; narrow;
   circumscribed; illiberal; contracted; as, insular habits, opinions, or
   prejudices.

The act of separating a body from others by
   nonconductors, so as to prevent the transfer of electricity or of heat;
   also, the state of a body so separated.

Incapable of being supported or borne; unendurable;
   insufferable; intolerable; as, insupportable burdens; insupportable
   pain.

The state or quality of being entire or complete;
   wholeness; entireness; unbroken state; as, the integrity of an empire
   or territory.

Possessed of intelligence, education, or judgment;
   knowing; sensible; skilled; marked by intelligence; as, an intelligent
   young man; an intelligent architect; an intelligent answer.

The act of becoming, or state of being, intemperate;
   excess in any kind of action or indulgence; any immoderate indulgence
   of the appetites or passions.

Extreme in degree; excessive; immoderate; as: (a) Ardent;
   fervent; as, intense heat. (b) Keen; biting; as, intense cold. (c)
   Vehement; earnest; exceedingly strong; as, intense passion or hate. (d)
   Very severe; violent; as, intense pain or anguish. (e) Deep; strong;
   brilliant; as, intense color or light.

The state or quality of being intense; intenseness;
   extreme degree; as, intensity of heat, cold, mental application,
   passion, etc.

Having the mind closely directed to or bent on an object;
   sedulous; eager in pursuit of an object; -- formerly with to, but now
   with on; as, intent on business or pleasure.

A stretching or bending of the mind toward of the mind
   toward an object; closeness of application; fixedness of attention;
   earnestness.

To insert among others, as a verse in a stanza;
   specif. (Geol.), to introduce as a bed or stratum, between the layers
   of a regular series of rocks.

To put each in the place of the other; to give and
   take mutually; to exchange; to reciprocate; as, to interchange places;
   they interchanged friendly offices and services.

Engaging the attention; exciting, or adapted to
   excite, interest, curiosity, or emotion; as, an interesting story;
   interesting news.

Participation in advantage, profit, and responsibility;
   share; portion; part; as, an interest in a brewery; he has parted with
   his interest in the stocks.

Being within any limits, inclosure, or substance; inside;
   internal; inner; -- opposed to exterior, or superficial; as, the
   interior apartments of a house; the interior surface of a hollow ball.

Hence: To insert between; to mix or mingle;
   especially, to introduce that which is foreign or irrelevant; as, to
   interlard a conservation with oaths or allusions.

To unite, embrace, communicate with, or flow into,
   one another; to be connected in one system; to lock into one another;
   to interlace firmly.

Lying or being in the middle place or degree, or
   between two extremes; coming or done between; intervening; interposed;
   interjacent; as, an intermediate space or time; intermediate colors.

Without termination; admitting no limit; boundless;
   endless; wearisomely protracted; as, interminable space or duration;
   interminable sufferings.

Cessation for a time; an intervening period of time;
   an interval; a temporary pause; as, to labor without intermission; an
   intermission of ten minutes.

Inward; interior; being within any limit or surface;
   inclosed; -- opposed to external; as, the internal parts of a body, or
   of the earth.

Derived from, or dependent on, the thing itself;
   inherent; as, the internal evidence of the divine origin of the
   Scriptures.

The state of being interrupted; a breach or break,
   caused by the abrupt intervention of something foreign; intervention;
   interposition.

A brief space of time between the recurrence of similar
   conditions or states; as, the interval between paroxysms of pain;
   intervals of sanity or delirium.

To come between, or to be between, persons or things;
   -- followed by between; as, the Mediterranean intervenes between Europe
   and Africa.

Any interference that may affect the interests of
   others; especially, of one or more states with the affairs of another;
   mediation.

Internal with regard to a state or country; domestic;
   not foreign; -- applied usually to that which is evil; as, intestine
   disorders, calamities, etc.

To suggest obscurely or indirectly; to refer to remotely;
   to give slight notice of; to hint; as, he intimated his intention of
   resigning his office.

Expressing penetration beyond the outside or surface, or
   access to the inside, or contents; as, to look into a letter or book;
   to look into an apartment.

Not tolerable; not capable of being borne or endured;
   not proper or right to be allowed; insufferable; insupportable;
   unbearable; as, intolerable pain; intolerable heat or cold; an
   intolerable burden.

Not tractable; not easily governed, managed, or
   directed; indisposed to be taught, disciplined, or tamed; violent;
   stubborn; obstinate; refractory; as, an intractable child.

Not transitive; not passing over to an object;
   expressing an action or state that is limited to the agent or subject,
   or, in other words, an action which does not require an object to
   complete the sense; as, an intransitive verb, e. g., the bird flies;
   the dog runs.

Inward; internal; hence, true; genuine; real; essential;
   inherent; not merely apparent or accidental; -- opposed to extrinsic;
   as, the intrinsic value of gold or silver; the intrinsic merit of an
   action; the intrinsic worth or goodness of a person.

The act of formally making persons known to each
   other; a presentation or making known of one person to another by name;
   as, the introduction of one stranger to another.

That part of a book or discourse which introduces or
   leads the way to the main subject, or part; preliminary; matter;
   preface; proem; exordium.

A formal and elaborate preliminary treatise;
   specifically, a treatise introductory to other treatises, or to a
   course of study; a guide; as, an introduction to English literature.

The act of intruding, or of forcing in; especially, the
   forcing (one's self) into a place without right or welcome;
   encroachment.

To enlarge or expand with heat; to swell;
   specifically, to swell up or bubble up under the action of heat, as
   before the blowpipe.

To apply in use; to train; to discipline; to use or
   accustom till use gives little or no pain or inconvenience; to harden;
   to habituate; to practice habitually.

To pass into use; to take or have effect; to be applied;
   to serve to the use or benefit of; as, a gift of lands inures to the
   heirs.

Uselessness; the quality of being unprofitable;
   unprofitableness; as, the inutility of vain speculations and visionary
   projects.

To render invalid; to weaken or lessen the force of;
   to destroy the authority of; to render of no force or effect; to
   overthrow; as, to invalidate an agreement or argument.

To lead astray as if blind; to persuade to something
   evil by deceptive arts or flattery; to entice; to insnare; to seduce;
   to wheedle.

To clothe, as with office or authority; to place in
   possession of rank, dignity, or estate; to endow; to adorn; to grace;
   to bedeck; as, to invest with honor or glory; to invest with an estate.

Firmly established by long continuance; obstinate;
   deep-rooted; of long standing; as, an inveterate disease; an inveterate
   abuse.

Wrought or worked in or among other things;
   worked into any fabric so as to from a part of its texture; wrought or
   adorned, as with figures.

That can not be successfully resisted or opposed;
   superior to opposition; resistless; overpowering; as, an irresistible
   attraction.

Want of resolution; want of decision in purpose; a
   fluctuation of mind, as in doubt, or between hope and fear;
   irresoluteness; indecision; vacillation.

Incapable of being recalled or revoked; unchangeable;
   irreversible; unalterable; as, an irrevocable promise or decree;
   irrevocable fate.

Endowed with irritability; susceptible of irritation;
   capable of being excited to action by the application of certain
   stimuli.

To make morbidly excitable, or oversensitive; to fret;
   as, the skin is irritated by friction; to irritate a wound by a coarse
   bandage.

Having equal density, as different regions of a medium;
   passing through points at which the density is equal; as, an isopycnic
   line or surface.

The act of sending out, or causing to go forth; delivery;
   issuance; as, the issue of an order from a commanding officer; the
   issue of money from a treasury.

To be produced as an effect or result; to grow or accrue;
   to arise; to proceed; as, rents and profits issuing from land,
   tenements, or a capital stock.

To print in Italic characters; to underline
   written letters or words with a single line; as, to Italicize a word;
   Italicizes too much.

To wander without a settled habitation; to travel
   from place or on a circuit, particularly for the purpose of preaching,
   lecturing, etc.
